<li><a href="#64ci-%E6%A3%80%E6%9F%A5%E4%B8%8D%E8%BF%87commit-message-%E7%9B%B8%E5%85%B3%E9%97%AE%E9%A2%98%E5%A6%82%E4%BD%95%E4%BF%AE%E5%A4%8D">6.4、CI 检查不过：commit message 相关问题如何修复？</a></li>
