<p><a href="https://mp.weixin.qq.com/s/CljCSezUgoBXb-T9wbIGww" target="_blank" rel="noopener noreferrer">二哥的编程星球</a>已经有 <strong>1100 多名</strong> 球友加入了，如果你也需要一个良好的学习氛围，<a href="https://mp.weixin.qq.com/s/hXXBTPPkFj2VMg_GXqn4EA" target="_blank" rel="noopener noreferrer">戳链接</a>加入我们吧！这是一个编程学习指南+ Java项目实战+LeetCode 刷题的私密圈子，你可以阅读星球专栏、向二哥提问、帮你制定学习计划、和球友一起打卡成长，冲冲冲。</p>
